import styled from '@emotion/styled';

const Outline = styled.div`
  border: 1px solid;
  margin-bottom: 40px;
`;

const Img = styled.img`
  max-width: 100%;
  height: auto;
`;

const Wrapper = styled.div`
  display: grid;
`;

const Title = styled.div`
  grid-column: 1 / 2;
  grid-row: 1;
`;
const Tag = styled.div`
  grid-column: 2 / 2;
  grid-row: 1;
`;
const Price = styled.div`
  grid-column: 1 / 3;
  grid-row: 2;
`;
const Etc = styled.div`
  grid-row: 3;
`;

export const Card = {
  Outline,
  Img,
  Wrapper,
  Title,
  Tag,
  Price,
  Etc,
};

export default Card;
